import React from "react";

function Footer() {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <img
            src="media/images/logo.svg"
            alt="logo"
            style={{ width: "20%" }}
          />
        </div>
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </div>
  );
}

export default Footer;
